import React from 'react'
import './style.css'

function Card(props) {
    return(
        <React.Fragment>
            <div className = "all-cards"> 
                <div className = "single-card">
                    <img src = {props.osImg} alt = "distro-img" />
                    <div className = "other-card-info">
                        <span className = "distro-name"> {props.osName} </span> <br /> 
                        <span className = "pkg-mngr"> Managed by: {props.osPkgMngr} </span> <br />
                        <a href = {props.osURL} target = "blank">
                            <button> Watch Now </button>
                      </a>
                    </div>
                </div>
            </div>
        </React.Fragment>
    );
}

export default Card
